const Login = ({onLogin}) => {
    return (
    <div className="login">
        <h1 className="login__title">Вход</h1>

        <form className="input__form" onSubmit={onLogin}>
            <input className="login__input " id="email" value={email} name="email" type="email" placeholder="Email"  onChange={handleEmail}></input>
            <input className="login__input " placeholder="Пароль"></input>
            <button className="login__button">Войти</button>
        </form>
    </div>
    );
};

export default Login;
